void cbWorker(dyn_string dp, dyn_anytype val){
    //--dyn_dyn_anytype dd_vals = sortData(val);  // convert values to dyn_dyn anytype
    //--dyn_dyn_string dd_dps  = sortData(dp);    // convert datapoints to dyn_dyn anytype

    //--for(int i=1; i&lt;=dynlen(dd_vals); i++){
      // Mass flow
  //DebugN(dp[1],&quot;11111&quot;);
      sdShowValue(&quot;txt1_flow_m&quot;, dp[1], val[1], 1, &quot;1&quot;, 0, &quot;&quot;);      //1-  массовый расход
      setValue(&quot;eu1_flow_m&quot;, &quot;text&quot;, dpGetUnit(dp[1]));
       // Pressure
      sdShowValue(&quot;txt1_press&quot;, dp[2], val[2], 1, &quot;1&quot;, 0, &quot;&quot;);       //2-  давление
      setValue(&quot;eu1_press&quot;, &quot;text&quot;, dpGetUnit(dp[2]));
      // Temperature
      sdShowValue(&quot;txt1_temp&quot;, dp[3], val[3], 1, &quot;1&quot;, 0, &quot;&quot;);        //3-  температура
      setValue(&quot;eu1_temp&quot;, &quot;text&quot;, dpGetUnit(dp[3]));
      // Average temp
      sdShowValue(&quot;txt1_atemp&quot;, dp[4], val[4], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu1_atemp&quot;, &quot;text&quot;, dpGetUnit(dp[4]));
      // Density
      sdShowValue(&quot;txt1_dens&quot;, dp[5], val[5], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu1_dens&quot;, &quot;text&quot;, dpGetUnit(dp[5]));
      // Average density
      sdShowValue(&quot;txt1_adens&quot;, dp[6], val[6], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu1_adens&quot;, &quot;text&quot;, dpGetUnit(dp[6]));
      // Total volume
      sdShowValue(&quot;txt1_vol&quot;, dp[7], val[7], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu1_vol&quot;, &quot;text&quot;, dpGetUnit(dp[7]));
      // Total mass
      sdShowValue(&quot;txt1_mass&quot;, dp[8], val[8], 1, &quot;1&quot;, 0, &quot;&quot;);        //8-  общая масса
      setValue(&quot;eu1_mass&quot;, &quot;text&quot;, dpGetUnit(dp[8]));
      // current status post
      string res;
      switch(val[9]){
        case 0x00:
          res = &quot;Ожидание&quot;;
          break;
        case 0x10:
          res = &quot;Разрешение налива&quot;;
          break;
        case 0x20:
          res = &quot;Налив&quot;;
          break;
        case 0x30:
          res = &quot;Пауза&quot;;
          break;
        case 0x40:
          res = &quot;Продолжение&quot;;
          break;
        case 0x60:
          res = &quot;Ошибка&quot;;
          break;
        case 0x80:
          res = &quot;Не активный&quot;;
          break;
        default:
          res = &quot;Неизвестно&quot;;
      }
      setValue(&quot;pst1_sts&quot;, &quot;text&quot;, res);

      // Total dose
      sdShowValue(&quot;txt1_mass_dose&quot;, dp[19], val[19], 1, &quot;1&quot;, 0, &quot;&quot;); //19- Массовая доза
      setValue(&quot;eu1_mass_dose&quot;, &quot;text&quot;, dpGetUnit(dp[19]));
      // Total fact
      sdShowValue(&quot;txt1_mass_fact&quot;, dp[20], val[20], 1, &quot;1&quot;, 0, &quot;&quot;); //20- Масса фактическая
      setValue(&quot;eu1_mass_fact&quot;, &quot;text&quot;, dpGetUnit(dp[20]));

      // Vol dose
      sdShowValue(&quot;txt1_vol_dose&quot;, dp[16], val[16], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu1_vol_dose&quot;, &quot;text&quot;, dpGetUnit(dp[16]));
      // Vol fact
      sdShowValue(&quot;txt1_vol_fact&quot;, dp[17], val[17], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu1_vol_fact&quot;, &quot;text&quot;, dpGetUnit(dp[17]));
      // Vol flow
      sdShowValue(&quot;txt1_flow_v&quot;, dp[18], val[18], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu1_flow_v&quot;, &quot;text&quot;, dpGetUnit(dp[18]));
      // Vol 15
      sdShowValue(&quot;txt1_vol15&quot;, dp[21], val[21], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu1_vol15&quot;, &quot;text&quot;, dpGetUnit(dp[21]));
      // Dens_15
      sdShowValue(&quot;txt1_dens15&quot;, dp[22], val[22], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu1_dens15&quot;, &quot;text&quot;, dpGetUnit(dp[22]));

      // last stop state
      setValue(&quot;pst1_stp&quot;, &quot;text&quot;, stpToText(val[10]));            //10- состояние кнопки стоп
      // Overpass state
      if(val[12] == 1)
        setValue(&quot;pst1_ovr&quot;, &quot;backCol&quot;, &quot;Red&quot;);
      else
        setValue(&quot;pst1_ovr&quot;, &quot;backCol&quot;, &quot;Green&quot;);
      // Valve state
      if(val[13] == 1)
        setMultiValue(&quot;pst1_vlv1&quot;, &quot;backCol&quot;, &quot;Green&quot;,
                      &quot;pst1_vlv2&quot;, &quot;backCol&quot;, &quot;Green&quot;);
      else
        setMultiValue(&quot;pst1_vlv1&quot;, &quot;backCol&quot;, &quot;Yellow&quot;,
                      &quot;pst1_vlv2&quot;, &quot;backCol&quot;, &quot;Yellow&quot;);
      // Filter state
      if(val[14] == 1)
        setValue(&quot;pst1_fltr&quot;, &quot;backCol&quot;, &quot;Red&quot;);
      else
        setValue(&quot;pst1_fltr&quot;, &quot;backCol&quot;, &quot;Green&quot;);
      // Product state
      if(val[15] == 1)
        setValue(&quot;pst1_prdct&quot;, &quot;backCol&quot;, &quot;Green&quot;);
      else
        setValue(&quot;pst1_prdct&quot;, &quot;backCol&quot;, &quot;Red&quot;);

      if(val[23] == 1)
        setValue(&quot;trap&quot;, &quot;backCol&quot;, &quot;Green&quot;);
      else
        setValue(&quot;trap&quot;, &quot;backCol&quot;, &quot;Red&quot;);

      if(val[24] == 1)
        setValue(&quot;work_pos&quot;, &quot;backCol&quot;, &quot;Green&quot;);
      else
        setValue(&quot;work_pos&quot;, &quot;backCol&quot;, &quot;Red&quot;);

      if(val[25] == 1)
        setValue(&quot;ground&quot;, &quot;backCol&quot;, &quot;Green&quot;);
      else
        setValue(&quot;ground&quot;, &quot;backCol&quot;, &quot;Red&quot;);

      if(val[26] == 1)
        setValue(&quot;garage_pos&quot;, &quot;backCol&quot;, &quot;Green&quot;);
      else
        setValue(&quot;garage_pos&quot;, &quot;backCol&quot;, &quot;Red&quot;);

      //sdShowValue(&quot;doz_min_part&quot;, dp[27], val[27], 1, &quot;1&quot;, 0, &quot;&quot;);
      sdShowValue(&quot;doz_proc&quot;, dp[28], val[28], 1, &quot;1&quot;, 0, &quot;&quot;);
      //sdShowValue(&quot;doz_up_down&quot;, dp[29], val[29], 1, &quot;1&quot;, 0, &quot;&quot;);

      if(val[31] == 1)
        setValue(&quot;doz_pump_sts&quot;, &quot;backCol&quot;, &quot;Green&quot;);
      else
        setValue(&quot;doz_pump_sts&quot;, &quot;backCol&quot;, &quot;Yellow&quot;);

      // Ground state
      switch(val[11]){
        case 1: // ground garage
          setMultiValue(&quot;pst1_gnd_ok&quot;, &quot;visible&quot;, false,
                        &quot;pst1_gnd_no&quot;, &quot;visible&quot;, false,
                        &quot;pst1_gnd_gr&quot;, &quot;visible&quot;, true);
          break;
        case 2:  // ground ok
          setMultiValue(&quot;pst1_gnd_ok&quot;, &quot;visible&quot;, true,
                        &quot;pst1_gnd_no&quot;, &quot;visible&quot;, false,
                        &quot;pst1_gnd_gr&quot;, &quot;visible&quot;, false);
          break;
        default:  // ground none
          setMultiValue(&quot;pst1_gnd_ok&quot;, &quot;visible&quot;, false,
                        &quot;pst1_gnd_no&quot;, &quot;visible&quot;, true,
                        &quot;pst1_gnd_gr&quot;, &quot;visible&quot;, false);
    }
      PUSH_BUTTON2.visible(val[34]==0);
      PUSH_BUTTON4.visible(val[34]==1);
      if(val[34] == 1)
        setValue(&quot;cEmulationLoading&quot;, &quot;backCol&quot;, &quot;Green&quot;);
      else
        setValue(&quot;cEmulationLoading&quot;, &quot;backCol&quot;, &quot;Grey&quot;);

  //--}
}

