main(mapping event)
{

const string DP = $dp;
const string NumberPost = $NumberPost;
dyn_string Adr;
dyn_float new_okr;
int x;
float perc;
Adr[1] = DP + &quot;.Post&quot; + NumberPost + &quot;.сPrisadka&quot;;	   //Налив с присадкой
Adr[2] = DP + &quot;.Global_Variable.bui_PercentPrisadki_&quot; + NumberPost + &quot;Post&quot;;	          //Процент присадки
dpGet(Adr[1], x);
if(x == 0)
 x = 1;
else
 x = 0;
new_okr[1] = x;
dpGet(Adr[2], perc);
new_okr[2] = perc;
for (int i=1;i&lt;=2;i++) {
dpSetWait(Adr[i], new_okr[i]);
}


}

